import React, { useState } from 'react';
import axios from 'axios';

function App() {
  const [data, setData] = useState('');
  const [inputData, setInputData] = useState('');

  const handleGetRequest = async () => {
    try {
      const response = await axios.get('http://localhost:8080/flights/getFlightById/1');
      setData(response.data);
    } catch (error) {
      console.error('Error:', error);
    }
  };

  const handlePostRequest = async () => {
    try {
      const response = await axios.post('http://localhost:8080/flights/create', {
        key: inputData
      });
      setData(response.data);
    } catch (error) {
      console.error('Error:', error);
    }
  };

  return (
      <div>
        <h1>React + Spring Boot App</h1>
        <button onClick={handleGetRequest}>GET Request</button>
        <input
            type="text"
            value={inputData}
            onChange={(e) => setInputData(e.target.value)}
        />
        <button onClick={handlePostRequest}>POST Request</button>
        <p>Response: {data}</p>
      </div>
  );
}

export default App;
